// import logo from './logo.svg';
import React from "react";
import "./components/scss/style.css";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../node_modules/bootstrap/dist/js/bootstrap.bundle.min.js";
import Navbar from "./components/Navbar/navbar";
import * as TagName from "./components/constants/constants";
import { Route, Switch } from "react-router-dom";
import Home from "./components/Pages/home";
import Shop from "./components/Pages/shop";
import Services from "./components/Pages/services";
import Blog from "./components/Pages/blog";
import About from "./components/Pages/about";
import Contact from "./components/Pages/contact";

function App() {
  return (
    <React.Fragment>
      <div className="App">
        <Navbar />
        <div className="content">
          {/* {TagName.menus.map((menu) => {
              <Route path={menu.url} component={menu.name} />;
            })} */}
          <Switch>
            <Route path="/" component={Home} />
            <Route path="/shop" component={Shop} />
            <Route path="/services" component={Services} />
            <Route path="/blog" component={Blog} />
            <Route path="/blog" component={About} />
            <Route path="/blog" component={Contact} />
          </Switch>
        </div>
      </div>
    </React.Fragment>
  );
}

export default App;
